import com.google.common.collect.RangeMap;
import com.google.common.collect.TreeRangeMap;
import com.google.common.collect.Range;
import java.util.HashMap;

public class Main {
    public static void main(String[] args) {
        RangeMap<Integer, String> rangeMap = TreeRangeMap.create();
        HashMap<Integer, String> hashMap = new HashMap<>();

        // Initialize HashMap with some values
        for (int i = 0; i < 5; i++) {
            hashMap.put(i, "HashValue" + i);
        }

        // Add more ranges to the RangeMap
        rangeMap.put(Range.closed(11, 20), "Value2");
        rangeMap.put(Range.closed(21, 30), "Value3");

        // Perform some operations on HashMap
        for (int i = 0; i < 5; i++) {
            System.out.println("HashMap value: " + hashMap.get(i));
        }

        /* write */ rangeMap.put(Range.closed(1, 10), "Value1");

        // Check if certain keys exist in HashMap
        System.out.println("HashMap contains key 2: " + hashMap.containsKey(2));
        System.out.println("HashMap contains key 10: " + hashMap.containsKey(10));

        // Get values from RangeMap
        String rangeValue1 = rangeMap.get(15);
        String rangeValue2 = rangeMap.get(25);

        // Print the values retrieved from RangeMap
        System.out.println("RangeMap value for 15: " + rangeValue1);
        System.out.println("RangeMap value for 25: " + rangeValue2);

        /* read */ String value = rangeMap.get(5);

        System.out.println(value);

        // Perform some calculations
        int sum = 0;
        for (int i = 0; i < 5; i++) {
            sum += i;
        }
        System.out.println("Sum of numbers 0 to 4: " + sum);

        // Print all values in HashMap
        for (Integer key : hashMap.keySet()) {
            System.out.println("Key: " + key + ", Value: " + hashMap.get(key));
        }
    }
}
